class NavMenu  extends React.Component {
    render() {
        <nav className="chi-nav navbar fixed-top">
            <div className="brand-logo navbar-brand text-uppercase"><img src="/static/logo.png"></img></div>
        </nav>
    }
}

export default NavMenu
